import React from 'react';
import './navbar.css'; // Make sure to import your CSS file

const Navbar = () => {
  return (
  
  
  <> 
  
    <h1>Monitoring</h1>
 
    <nav className="container">
   


    
      <div className="flex-item">
        <a href="#">Pending</a>
        <a href="#">Completed</a>
    
      </div>

      <div className="flex-item">

   
        <a href="#">Close Account</a>
      </div>
    </nav>
    </>
  );
};

export default Navbar;
